diff --git a/mlir/lib/Dialect/Arith/IR/ArithOps.cpp b/mlir/lib/Dialect/Arith/IR/ArithOps.cpp
index e9545c3146b2..5839fbd58189 100644
--- a/mlir/lib/Dialect/Arith/IR/ArithOps.cpp
+++ b/mlir/lib/Dialect/Arith/IR/ArithOps.cpp
@@ -46,6 +46,20 @@ applyToIntegerAttrs(PatternRewriter &builder, Value res, Attribute lhs,
   APInt lhsVal = llvm::cast<IntegerAttr>(lhs).getValue();
   APInt rhsVal = llvm::cast<IntegerAttr>(rhs).getValue();
   APInt value = binFn(lhsVal, rhsVal);
+  
+  // Validate and adjust bit width before creating IntegerAttr
+  if (auto resultType = llvm::dyn_cast<IntegerType>(res.getType())) {
+    unsigned expectedWidth = resultType.getWidth();
+    unsigned actualWidth = value.getBitWidth();
+    
+    // Perform safe bit width conversion
+    if (actualWidth != expectedWidth) {
+      value = actualWidth > expectedWidth ? 
+              value.trunc(expectedWidth) : 
+              value.sext(expectedWidth);
+    }
+  }
+  
   return IntegerAttr::get(res.getType(), value);
 }
